import React from 'react';
import { Link } from 'react-router-dom';
import AccountNavBarComponent from './components/AccountNavBarComponent';



const NavBar = () => (
  <nav>
    <ul>
      <li>
        <Link to="/">Home</Link>
      </li>
      <li>
        <Link to="/add-new-vacancy/">Add new Job</Link>
      </li>
        <AccountNavBarComponent state="default" account="" />
    </ul>
  </nav>
);

export default NavBar;
